import { Ionicons } from '@expo/vector-icons';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
const Tab = createBottomTabNavigator();
import axios from 'axios';
import { Avatar, AvatarBadge, AvatarFallbackText, AvatarImage } from '@gluestack-ui/themed';
//<--- views---> //
import FavoritesView from './FavoritesView';
import Bagview from './BagView';
import MyStack from './Components/Stack';
import SearchView from './SearchView';
import React, { useState, useEffect } from 'react';
import AsyncStorage from '@react-native-async-storage/async-storage'//async

const HomeView = () => {
    const [userData, setUserData] = useState({});
    const [isOpen, setIsOpen] = useState(false);

    let tokenString;
    let token;

    const handleLogout = () => {
        // Aquí puedes agregar la lógica para cerrar la sesión
        console.log('Sesión cerrada');
        setIsOpen(false);
    };

    useEffect(() => {
        const fetchUserData = async () => {
            tokenString = await AsyncStorage.getItem('token');
            token = JSON.parse(tokenString);
            let idUser;
            let carUser = [];
            let caarEnd = [];
            let total = 0;

            console.log("hola");

            if (token) {
                console.log("entro");

                try {
                    console.log("holados");

                    const response = await axios.get("http://localhost/1.75/backend/public/api/Userauth", {
                        headers: {
                            'Authorization': `Bearer ${token}`
                        }
                    });
                    console.log("usuario", response);
                    setUserData(response.data);
                    idUser = response.data.id;


                } catch (error) {
                    console.log(" we cannot get the information ", error);
                }
            }

        };

        fetchUserData();


    }, []);

    return (
        <Tab.Navigator
            screenOptions={({ route }) => ({
                tabBarIcon: ({ focused, color, size }) => {
                    let iconName;
                    if (route.name === 'Home') {
                        iconName = focused ? 'home' : 'home-outline';
                    } else if (route.name === 'Search') {
                        iconName = focused ? 'search' : 'search-outline';
                    } else if (route.name === 'Bag shop') {
                        iconName = focused ? 'bag' : 'bag-outline';
                    } else if (route.name === 'Favorites') {
                        iconName = focused ? 'heart' : 'heart-outline';
                    }
                    return <Ionicons name={iconName} size={size} color={color} />;
                },
            })}
            tabBarOptions={{
                activeTintColor: '#FFA600',
                inactiveTintColor: 'gray',
            }}
        >
            <Tab.Screen name="Home" component={MyStack} options={{
                headerShown: true, header: () => {
                    return (
                        <div>
                            <Avatar margin={"$3px"} bgColor='$amber600' size="md" borderRadius="$full" onClick={() => setIsOpen(true)}>
                                <AvatarFallbackText>{userData.Name}</AvatarFallbackText>
                            </Avatar>

                            {isOpen && (
                                <div>
                                    <p>¿Estás seguro de que quieres cerrar la sesión?</p>
                                    <button onClick={handleLogout}>Sí</button>
                                    <button onClick={() => setIsOpen(false)}>No</button>
                                </div>
                            )}
                        </div>
                    );
                }
            }} />
            <Tab.Screen name="Search" component={SearchView} options={{
                headerShown: true, header: () => {
                    return (
                        <div>
                            <Avatar margin={"$3px"} bgColor='$amber600' size="md" borderRadius="$full" onClick={() => setIsOpen(true)}>
                                <AvatarFallbackText>{userData.Name}</AvatarFallbackText>
                            </Avatar>

                            {isOpen && (
                                <div>
                                    <p>¿Estás seguro de que quieres cerrar la sesión?</p>
                                    <button onClick={handleLogout}>Sí</button>
                                    <button onClick={() => setIsOpen(false)}>No</button>
                                </div>
                            )}
                        </div>
                    );
                }
            }} />
            <Tab.Screen name="Bag shop" component={Bagview} options={{ headerShown: false }} />
            <Tab.Screen name="Favorites" component={FavoritesView} options={{
                headerShown: true, header: () => {
                    return (
                        <div>
                            <Avatar margin={"$3px"} bgColor='$amber600' size="md" borderRadius="$full" onClick={() => setIsOpen(true)}>
                                <AvatarFallbackText>{userData.Name}</AvatarFallbackText>
                            </Avatar>

                            {isOpen && (
                                <div>
                                    <p>¿Estás seguro de que quieres cerrar la sesión?</p>
                                    <button onClick={handleLogout}>Sí</button>
                                    <button onClick={() => setIsOpen(false)}>No</button>
                                </div>
                            )}
                        </div>
                    );
                }
            }} />
        </Tab.Navigator>
    );
};
export default HomeView;
